import {
Box,
Container,
Row,
Heading,
} from "./FooterStyles";
import "./Icons.css";

const Footer = () => {
return (
	<Box>
	<Container>
		<Row>
			<br></br>
			<Heading>Social Media</Heading>
			<a href="#" className="fa fa-facebook">
			</a>
			<a href="#" className="fa fa-twitter">
			</a>
			<a href="#" className="fa fa-instagram">
			</a>
		</Row>
	</Container>
	</Box>
);
};
export default Footer;
